To break out of the xml structure we perform the following steps: Replace html-strings &amp;, &quot;, &nbsp;, &lt; and &gt; by &, `, ,<and>, repsectively. * First the&, as it's used as the&in other sequences, e.g. . * The<and>from<and&gtare used in tags. * The"from"` is irrelevant, so we drop it entirely. This is not an exhaustive list, so there may be other Remove the following start- and stop-tags, and the contents in between: id ns parentid timestamp contributor comment model format sha1 We remove any tag, i.e., anything of the form <A> for any string A. We remove anything enclosed in double-curly-braces, i.e., anything on the form {{A}} for any A. def filter_xml(source : String) = { val noAmp = raw"&amp;".r.replaceAllIn(source, "&") val noNbsp = raw"&nbsp;".r.replaceAllIn(noAmp, " ") val noQuot = raw"&quot;".r.replaceAllIn(noNbsp, "") val noLt = raw"&lt;".r.replaceAllIn(noQuot, "<") val noGt = raw"&gt;".r.replaceAllIn(noLt, ">") val tags = Seq("id", "ns", "parentid", "timestamp", "contributor", "comment", "model", "format", "sha1") var current = noGt for (tag <- tags) { val start = s"<$tag>".r val end = s"</$tag>".r while (start.findAllIn(current).hasNext) { val a = start.findAllIn(current).start val b = end.findAllIn(current).start val len = current.length current = current.substring(0, a) + current.substring(b+tag.length+3, current.length) assert (current.length < len) } } current = raw"<[^<>]*>".r.replaceAllIn(current, "") // A loop to remove innermost curly braces, then outer such things. val curly = raw"\{[^\{\}]*\}".r while (curly.findAllIn(current).hasNext) { current = curly.replaceAllIn(current, "") } current } val filtered_xml = labelled_articles.map({ case(id, title, source) => (id, title, filter_xml(source)) }) filtered_xml.take(5) The resulting strings contain a lot of markup structure, and we clean it by: Removing all $ and \, as scala will otherwise try to help us by doing magic to them. Removing all of the sections "Se även", "Referenser", "Noter", "Källor" and "Externa länkar" Remove links: Replace unnamed internal links [[LinkName]] by LinkName Replace named internal links [[Link|Properties|Name]] by Name Replace unnamed internal links again to clean up Replace named external links [Link Name] by Name Replace unnamed external links [Link] by Link Convert all text to lower case Remove quotation marks ' Remove repeated whitespace, as the obtained results contain a lot of whitespace. Note: The last line in the cell below incorrectly gets rendered as a string, as the databricks notebook does not realize that (on line 3) the string raw"\" ends there, but it guesses that \" is a quoted character and that the string continues to the end of the cell. def sanitize(source: String) : String = { val noDollar = source.replaceAllLiterally("$", "") val noBackSlash = noDollar.replaceAllLiterally(raw"\", "") noBackSlash
} val sanitized_xml = filtered_xml.map({case(id, title, source) => (id, title, sanitize(source))}) sanitize: (source: String)String
